import React from "react";
import {
  Menu,
  MenuButton,
  MenuList,
  MenuItem,
  MenuGroup,
  MenuDivider,
  useColorMode,
  Image,
  Text,
  Icon,
} from "@chakra-ui/core";

const ProjectSettings = () => {
  const { colorMode } = useColorMode();
  return (
    <Menu>
      <MenuButton
        display="flex"
        alignItems="center"
        backgroundColor={`mode.${colorMode}.background`}
      >
        <Image
          src="https://media.graphcms.com/GFjpdH7nTwSWUMaHn6HY"
          size={10}
          roundedLeft="sm"
          borderColor={`mode.${colorMode}.background`}
        />
        <Text ml={2} mr={8} color={`mode.${colorMode}.text`}>
          Web app
        </Text>
        <Icon name="chevron-down" mr={2} color={`mode.${colorMode}.text`} />
      </MenuButton>
      <MenuList>
        <MenuList>
          <MenuGroup title="Profile">
            <MenuItem color={`mode.${colorMode}.text`}>My Account</MenuItem>
            <MenuItem color={`mode.${colorMode}.text`}>Payments </MenuItem>
          </MenuGroup>
          <MenuDivider />
          <MenuGroup title="Help">
            <MenuItem color={`mode.${colorMode}.text`}>Docs</MenuItem>
            <MenuItem color={`mode.${colorMode}.text`}>FAQ</MenuItem>
          </MenuGroup>
        </MenuList>
      </MenuList>
    </Menu>
  );
};

export default ProjectSettings;
